"""## Data Manipulation

Data yang dimiliki berjenis kategorik jadi kami akan menggunakan Label Encoder untuk mengubahnya menjadi data ordinal. Label Encoder mengonversi setiap nilai dalam kolom menjadi angka.

Pendekatan ini membutuhkan kolom kategori menjadi tipe data 'kategori'. Secara default, kolom non-numerik adalah tipe data 'objek'. Dari metode **data.info()**, kita melihat bahwa kolom yang ada adalah tipe data 'objek'. Jadi kita harus mengubah tipe menjadi 'kategori' sebelum menggunakan pendekatan ini.
"""

data1 = data.astype('category')
data.dtypes

"""Sekarang kita telah mengonversi kolom menjadi tipe kategori, kita dapat menggunakan LabelEncoder untuk membuat kolom menjadi format yang dapat dimengerti python."""

from sklearn.preprocessing import LabelEncoder
labelencoder=LabelEncoder()
for column in data.columns:
    data1[column] = labelencoder.fit_transform(data[column])

data1.head()

data1['veil-type'].value_counts()

"""dari tabel di atas kita dapat melihat bahwa veil-type hanya memiliki satu nilai unik dan karenanya tidak dapat memberikan kontribusi apa pun pada data. Jadi kita bisa menghapusnya. (udah aku cek satu-satu)"""

data2 = data1.drop(["veil-type"],axis=1)

data2.head()

data2['class'].value_counts()

