"""## **Prepare Data to Train and Test**"""

from sklearn.model_selection import train_test_split
X = data2.drop(['class'], axis=1)  
y = data2["class"]

X_train, X_test, y_train, y_test = train_test_split(X, y, random_state=30, test_size=0.2)

"""data test = 20
data training = 80

## **Clasification Methods**

### **Desicion Tree Classification**
"""

from sklearn.tree import DecisionTreeClassifier
dt = DecisionTreeClassifier()
dt.fit(X_train, y_train)

from sklearn.tree import export_graphviz
import graphviz

dtree = export_graphviz(dt, out_file=None,feature_names=X.columns,class_names=data["class"],filled=True,rounded=True,special_characters=True)  
graph = graphviz.Source(dtree)
graph

"""#### **Feature Importance**

By all methods examined before the feature that is most important is "gill-color".
"""

features_list = X.columns.values
feature_importance = dt.feature_importances_
sorted_idx = np.argsort(feature_importance)

plt.figure(figsize=(8,7))
plt.barh(range(len(sorted_idx)), feature_importance[sorted_idx], align='center', color ="green")
plt.yticks(range(len(sorted_idx)), features_list[sorted_idx])
plt.xlabel('Importance')
plt.title('Feature importance')
plt.draw()
plt.show()

"""#### **Predicting and Estimating Result**"""

y_pred_dt = dt.predict(X_test)

print("Decision Tree Classifier report: \n\n", classification_report(y_test, y_pred_dt))

print("Test Accuracy: {}%".format(round(dt.score(X_test, y_test)*100, 2)))

"""#### **Confusion Matrix for Desicion Tree Classifier**"""

cm = confusion_matrix(y_test, y_pred_dt)

x_axis_labels = ["Edible", "Poisonous"]
y_axis_labels = ["Edible", "Poisonous"]

f, ax = plt.subplots(figsize =(7,7))
sns.heatmap(cm, annot = True, linewidths=0.2, linecolor="black", fmt = ".0f", ax=ax, cmap="coolwarm", xticklabels=x_axis_labels, yticklabels=y_axis_labels)
plt.xlabel("PREDICTED LABEL")
plt.ylabel("TRUE LABEL")
plt.title('Confusion Matrix for Decision Tree Classifier')
plt.show()

"""### **KNN Classification**"""

from sklearn.neighbors import KNeighborsClassifier

best_Kvalue = 0
best_score = 0

for i in range(1,10):
    knn = KNeighborsClassifier(n_neighbors=i)
    knn.fit(X_train, y_train)
    if knn.score(X_test, y_test) > best_score:
        best_score = knn.score(X_train, y_train)
        best_Kvalue = i
        
print("Best KNN Value: {}".format(best_Kvalue))
print("Test Accuracy: {}%".format(round(best_score*100,2)))

"""#### **Classification Report of KNN Clasifier**"""

y_pred_knn = knn.predict(X_test)
print("KNN Classifier report: \n\n", classification_report(y_test, y_pred_knn))

"""#### **Confusion Matrix for KNN Classifier**"""

cm = confusion_matrix(y_test, y_pred_knn)

x_axis_labels = ["Edible", "Poisonous"]
y_axis_labels = ["Edible", "Poisonous"]

f, ax = plt.subplots(figsize =(7,7))
sns.heatmap(cm, annot = True, linewidths=0.2, linecolor="black", fmt = ".0f", ax=ax, cmap="Greens", xticklabels=x_axis_labels, yticklabels=y_axis_labels)
plt.xlabel("PREDICTED LABEL")
plt.ylabel("TRUE LABEL")
plt.title('Confusion Matrix for KNN Classifier')
plt.show()

